INSERT INTO `email_templates` (`id`, `name`, `slug`, `subject`, `body`, `is_active`, `created_at`, `updated_at`) VALUES
(1, 'Standard', 'standard', 'Your order', 'Hello {{name}}, your order {{tracking_code}} was created.', 1, '2025-10-09 01:10:58', '2025-10-09 01:10:58'),
(2, 'Custom', 'custom', 'Payment instructions', '<p>Dear {{name}},<br><br>Please complete your payment for the selected service using PayPal.<br><br>PayPal Email: {{paypal_email}} &nbsp;<br>Payment URL: {{paypal_url}} &nbsp;<br>Amount: ${{amount}} &nbsp;<br>Service: {{service}} &nbsp;<br>Tracking Code: {{tracking_code}}<br><br>After you have successfully completed the payment, please click the link below to activate your account:<br><br>Activate your account → {{activation_url}}<br><br>Thank you for choosing our service.<br><br>Best regards, &nbsp;<br>{{app_name}} Team<br><br></p>', 1, '2025-10-09 01:10:58', '2025-10-17 00:28:22'),
(3, 'Send', 'send', 'Your Order created ', '<p>Dear {{name}},<br><br>Please complete your payment for the selected service using PayPal.<br><br>PayPal Email: {{paypal_email}} &nbsp;<br>Payment URL: {{paypal_url}} &nbsp;<br>Amount: ${{amount}} &nbsp;<br>Service: {{service}} &nbsp;<br>Tracking Code: {{tracking_code}}<br><br>After you have successfully completed the payment, please click the link below to activate your account:<br><br>Activate your account → {{activation_url}}<br><br>Thank you for choosing our service.<br><br>Best regards, &nbsp;<br>{{app_name}} Team<br><br></p>', 1, '2025-10-17 00:33:24', '2025-10-17 00:33:24'),
(4, 'geteway', 'getway', 'Your Paygate Payment Instructions', '<h2 style=\"color:#333;\">Hello {{ $name }},</h2>\n\n<p>Thank you for your order! Please complete your payment using <strong>Paygate (USDC / Polygon)</strong>.</p>\n\n<table style=\"border:1px solid #eee;padding:10px;margin:10px 0;\">\n  <tr><td><strong>Amount:</strong></td><td>{{ $amount }} {{ $token }}</td></tr>\n  <tr><td><strong>Network:</strong></td><td>{{ $chain }}</td></tr>\n  <tr><td><strong>Wallet:</strong></td><td><code>{{ $wallet }}</code></td></tr>\n</table>\n\n<p>\n  You can also pay directly using the link below:<br>\n  <a href=\"{{ $payment_url }}\" style=\"background:#4f46e5;color:white;padding:10px 15px;text-decoration:none;border-radius:6px;\">\n    Pay Now\n  </a>\n</p>\n\n<p style=\"color:#666;font-size:13px;margin-top:20px;\">\n⚠️ Please make sure to send exactly <strong>{{ $amount }} {{ $token }}</strong> on the <strong>{{ $chain }}</strong> network.<br>\nAfter payment, open a support ticket and include your transaction hash.\n</p>\n\n<p>Thank you,<br><strong>The PaymentACC Team</strong></p>\n', 1, '2025-10-18 23:18:06', '2025-10-18 23:18:06'),
(5, 'payget', 'payget', 'Paygete order Confirmation', '<h2>✅ Payment Confirmed</h2>\r\n<p>Dear {name},</p>\r\n<p>Your payment for <strong>{service}</strong> has been successfully processed.</p>\r\n<p><strong>Amount:</strong> ${amount}</p>\r\n<p><strong>Tracking Code:</strong> {tracking_code}</p>\r\n<p>Thank you for choosing PaymentACC.</p>', 1, '2025-10-19 23:45:35', '2025-10-20 00:03:39'),
(6, 'Nice', 'nice', 'Your PayPal Payment Instructions Inbox', '<pre>&lt;!DOCTYPE html&gt;\n&lt;html lang=\"en\"&gt;\n&lt;head&gt;\n    &lt;meta charset=\"UTF-8\"&gt;\n    &lt;title&gt;Your PayPal Payment Instructions&lt;/title&gt;\n&lt;/head&gt;\n&lt;body style=\"margin:0;padding:0;background-color:#f3f4f6;font-family:system-ui,-apple-system,BlinkMacSystemFont,\'Segoe UI\',sans-serif;\"&gt;\n\n&lt;table width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\" style=\"background-color:#f3f4f6;padding:24px 0;\"&gt;\n    &lt;tr&gt;\n        &lt;td align=\"center\"&gt;\n            &lt;table width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\" style=\"max-width:600px;background-color:#ffffff;border-radius:12px;overflow:hidden;border:1px solid #e5e7eb;\"&gt;\n\n                &lt;!-- Header --&gt;\n                &lt;tr&gt;\n                    &lt;td style=\"background:linear-gradient(135deg,#111827,#1f2937);padding:20px 24px;color:#f9fafb;\"&gt;\n                        &lt;div style=\"font-size:18px;font-weight:700;\"&gt;PaymentACC&lt;/div&gt;\n                        &lt;div style=\"font-size:13px;opacity:.9;margin-top:4px;\"&gt;\n                            PayPal Payment Instructions\n                        &lt;/div&gt;\n                    &lt;/td&gt;\n                &lt;/tr&gt;\n\n                &lt;!-- Body --&gt;\n                &lt;tr&gt;\n                    &lt;td style=\"padding:24px 24px 8px 24px;color:#111827;font-size:14px;line-height:1.6;\"&gt;\n\n                        &lt;p style=\"margin:0 0 12px 0;\"&gt;\n                            Dear {{name}},\n                        &lt;/p&gt;\n\n                        &lt;p style=\"margin:0 0 16px 0;\"&gt;\n                            Thank you for your order. Please complete your payment using PayPal with the details below.\n                        &lt;/p&gt;\n\n                        &lt;!-- Payment details card --&gt;\n                        &lt;table width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\" style=\"margin:8px 0 16px 0;\"&gt;\n                            &lt;tr&gt;\n                                &lt;td style=\"background-color:#f9fafb;border-radius:10px;border:1px solid #e5e7eb;padding:16px 18px;\"&gt;\n\n                                    &lt;p style=\"margin:0 0 6px 0;font-size:13px;color:#6b7280;text-transform:uppercase;letter-spacing:.06em;\"&gt;\n                                        Payment details\n                                    &lt;/p&gt;\n\n                                    &lt;p style=\"margin:0 0 6px 0;\"&gt;\n                                        &lt;strong&gt;PayPal email:&lt;/strong&gt;\n                                        {{gateway_email}}\n                                    &lt;/p&gt;\n\n                                    &lt;p style=\"margin:0 0 6px 0;\"&gt;\n                                        &lt;strong&gt;Payment URL:&lt;/strong&gt;\n                                        &lt;a href=\"{{gateway_link}}\" style=\"color:#2563eb;text-decoration:none;word-break:break-all;\"&gt;\n                                            {{gateway_link}}\n                                        &lt;/a&gt;\n                                    &lt;/p&gt;\n\n                                    &lt;p style=\"margin:0 0 6px 0;\"&gt;\n                                        &lt;strong&gt;Amount:&lt;/strong&gt;\n                                        ${{amount}}\n                                    &lt;/p&gt;\n\n                                    &lt;p style=\"margin:0;\"&gt;\n                                        &lt;strong&gt;Service:&lt;/strong&gt;\n                                        {{service}}\n                                    &lt;/p&gt;\n\n                                &lt;/td&gt;\n                            &lt;/tr&gt;\n                        &lt;/table&gt;\n\n                        &lt;p style=\"margin:0 0 18px 0;\"&gt;\n                            After you send the payment, please open your order summary using the link below and confirm your payment:\n                        &lt;/p&gt;\n\n                        &lt;!-- Button --&gt;\n                        &lt;table role=\"presentation\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin:0 0 20px 0;\"&gt;\n                            &lt;tr&gt;\n                                &lt;td align=\"center\"&gt;\n                                    &lt;a href=\"{{tracking_url}}\"\n                                       style=\"display:inline-block;background-color:#2563eb;color:#ffffff;\n                                              padding:10px 22px;border-radius:999px;font-size:14px;\n                                              text-decoration:none;font-weight:600;\"&gt;\n                                        View order summary\n                                    &lt;/a&gt;\n                                &lt;/td&gt;\n                            &lt;/tr&gt;\n                        &lt;/table&gt;\n\n                        &lt;p style=\"margin:0 0 12px 0;font-size:12px;color:#6b7280;line-height:1.5;\"&gt;\n                            Or paste this link into your browser:&lt;br&gt;\n                            &lt;span style=\"word-break:break-all;color:#2563eb;\"&gt;\n                                {{tracking_url}}\n                            &lt;/span&gt;\n                        &lt;/p&gt;\n\n                        &lt;p style=\"margin:18px 0 0 0;\"&gt;\n                            Thank you,&lt;br&gt;\n                            &lt;strong&gt;The PaymentACC Team&lt;/strong&gt;\n                        &lt;/p&gt;\n                    &lt;/td&gt;\n                &lt;/tr&gt;\n\n                &lt;!-- Footer --&gt;\n                &lt;tr&gt;\n                    &lt;td style=\"padding:12px 24px 18px 24px;text-align:center;font-size:11px;color:#9ca3af;background-color:#f9fafb;\"&gt;\n                        This email was sent automatically. Please do not reply directly to this message.\n                    &lt;/td&gt;\n                &lt;/tr&gt;\n\n            &lt;/table&gt;\n        &lt;/td&gt;\n    &lt;/tr&gt;\n&lt;/table&gt;\n\n&lt;/body&gt;\n&lt;/html&gt;\n<br></pre>', 1, '2025-11-24 04:19:06', '2025-11-24 04:19:16'),
(7, 'nowpay', 'nowpay', 'nowpay order Confirmation', '<h2>✅ Payment Confirmed</h2>\r\n<p>Dear {name},</p>\r\n<p>Your payment for <strong>{service}</strong> has been successfully processed.</p>\r\n<p><strong>Amount:</strong> ${amount}</p>\r\n<p><strong>Tracking Code:</strong> {tracking_code}</p>', 1, '2025-10-19 23:45:35', '2025-10-20 00:03:39'),
(8, 'reminder_1_day_before', 'reminder_1_day_before', 'Reminder: Your Order Expiration is Tomorrow', 'Dear {{customer_name}},\r\n\r\nThis is a reminder that your order (Order #{{order_id}}) will expire tomorrow. Please take the necessary action before it expires.\r\n\r\nBest regards,\r\nYour Company', 1, '2025-11-24 09:19:06', '2025-11-24 09:19:16'),
(9, 'reminder_4_day_before', 'reminder_4_day_before', 'Reminder: Your Order Expiration in 4 Days', 'Dear {{customer_name}},\r\n\r\nThis is a friendly reminder that your order (Order #{{order_id}}) will expire in 4 days. Don’t forget to complete any necessary actions before the expiration date.\r\n\r\nBest regards,\r\nYour Company', 1, '2025-11-24 09:19:06', '2025-11-24 09:19:16'),
(10, 'reminder_7_day_before', 'reminder_7_day_before', 'Reminder: Your Order Expiration in 7 Days', 'Dear {{customer_name}},\r\n\r\nWe wanted to remind you that your order (Order #{{order_id}}) will expire in 7 days. Please make sure to take the required actions before it expires.\r\n\r\nBest regards,\r\nYour Company', 1, '2025-11-24 09:19:06', '2025-11-24 09:19:16');
